import React from 'react';
import './Prix.css';
import Media from 'react-media';

// Return Prix Component Icon
export default function ReturnPrix() {
 return (
  <Media
   queries={{
    small: '(max-width: 599px)',
    medium: '(min-width: 600px) and (max-width:1199px)',
    large: '(min-width: 1200px)',
   }}>
   {matches => (
    <>
     {matches.small && <ScreenSmall />}
     {matches.medium && <ScreenLarge />}
     {matches.large && <ScreenLarge />}
    </>
   )}
  </Media>
 );
};


export const ScreenLarge = () => (
 <div className='wrp-exch-prix'>
  <ViewTextFc />
  <ViewTextUsd />
 </div>
);
export const ScreenSmall = () => (
 <div className='wrp-exch-prix-sm'>
  <ViewTextFc />
  <ViewTextUsd />
 </div>
);

export const ViewTextUsd = () => {

 const [usd, setUsd] = React.useState(413);
 return (
  <p className='wrp-exch-prix-red-bg'>
   <span className='wrp-exch-prix-green wrp-exch-prix-red'>{`${usd}`}</span>
   <span>USD</span>
  </p>
 )
}
export const ViewTextFc = () => {

 const [fc, setUsd] = React.useState(10413);
 return (
  <p className='wrp-exch-prix-green-bg'>
   <span className='wrp-exch-prix-green'>{`${fc}`}</span>
   <span>Fc</span>
  </p>
 )
}
